description:
Introducing our newest model, Yung Tay! Just 19 years old with a tight little body and, as this is her first shoot EVER, she has a fresh eagerness and anxiousness that you dont see in more seasoned models.  In this clip, Addie gets the opportunity to tickle Tays sensitive feet with all sorts of implements; feathers, electric toothbrush, plastic combs, a cat toy, a pinwheel, what have you, while she is locked into metal stocks. Tay is more of a giggler than a laugher; she gets really antsy about the anticipation of being tickled. What works the best is to put feathers between her toes! Yikes! Also, scratching the lower part of her heels with fingernails or a comb does the trick. It was definitely alot of fun to tickle this cutie! Tays two most ticklish spots are her feet and her underarms, but after tickling both, I realized that her underarms are definitely more ticklish. This clip is ALL foot tickling; only has a little taste of underarm tickling at the very end. So enjoy, foot ticking fans! Underarm tickling fans, watch out, because well be putting up the underarm tickling clip VERY soon...  Also, Tay gets foot revenge on Addie! Stay tuned!



